import React from 'react';
import Print from "./components/test.js"





const App = () => {

  const style = {
    width: "100px",
    height: "100px",
    backgroundColor: "pink"
  }


  return (
    <>
    <div style={style}>
      <header>
        <h1>Risk Radar</h1>

      </header>

       <h2>Happy Coding!!</h2>
       <h3>This is working!</h3>
    </div>
    <Print /> 
    </>

  );
};







export default App;
